import React from 'react';
import './Footer.css'; 

function Footer() {
  const currentYear = new Date().getFullYear();

  return (
    <footer className="footer">
      <p>Ran Regev &copy; {currentYear}</p>
    </footer>
  );
}

export default Footer;
